🍁🍁Thousand Miles between Us🍁🍁
🍂🍂🍂🍂🍂🍂🍂🍂🍂🍂🍂🍂🍂🍂
To know that I miss you 
  so much when you leave; 
To know that I need you 
  like the air that I breathe.
To know that I want you
  with a passion so blind,
 Is to know that I love you 
  with no doubt in my mind.
The lines stitched into highways; 
  the never-ending seams, 
  on roads that are less travelled, 
  dividing you and me
 I wish I could unravel,
 the fabric in-between, 
  and tear away the distance,
 to bring you close to me.
