Diamonds are forged from oppression, compression—impossible luck: so that the only outcome, is death or audacious elemental transformation. Not Paula. Paula was a gem from the start. Scarcely parlous. Precious stone, glaring in Eden’s misty dark. 

We met in a lecture theatre actually. She thought I was stuck-up and quite frankly, I didn’t notice her. But when I did, everything changed. I didn’t like it. 

Paula had entered my life at a time when I had forgotten what it meant to be a #person. You know, empathetic, reasonable, seldom agreeable... I was meticulous and over zealous. I had gathered what most people refered to as ‘exclusive #relationship,’ took much too much time to prepare and serve. It seemed somewhat contrary to my unorthodox or... savage affair. Chad was steeped in the opposite of love—impatient, unkind, giving only to mind—and I had joined him (or her, for Chad is still water) along for the ride. Knowing Paula immediately threatened that. 

She was wonderfully kind... and all the virtues that make you want to close your eyes and fall asleep, and dance—if she were not by your side. She was the #delight in #light... enchanting abscence of dim reality when you closed your eyes at night. You know... when a heart need not be brave—for all the monsters hidden in the husk of rage were slayed. 

Sometimes, when drenched in revelry, I would close my eyes and picture a world where I was sain and she and I were safe... and dating her was OK. That scarcely was the case. #Grief unattended to, had turned to rue, and rue, bitter emptiness so that to love a beautiful thing was to ruin it. And I knew it. 

